import { StyleSheet, Dimensions } from "react-native";
import Constants from "expo-constants";

export const Style = StyleSheet.create({
  home_container: {
    backgroundColor: "white",
    flex: 1,
  },
  room_wrapper: {
    paddingTop: 10,
    paddingBottom: 10,
    paddingLeft: 15,
    paddingRight: 15,
    borderBottomWidth: 1,
    borderBottomColor: "#F1F2F4",
    flexDirection: "row",
  },
  room_icon: {
    marginRight: 10,
  },
  room_icon_container: {
    backgroundColor: "#F1F2F4",
    width: 45,
    height: 45,
    borderRadius: 100,
    alignItems: "center",
    justifyContent: "center",
  },
  room_icon_title: {
    color: "black",
    fontSize: 14,
    fontWeight: "500",
  },
  header_title: {
    fontSize: 16,
    fontWeight: "600",
  },
  custom_room_list_footer: {},
  room_title_wrapper: {
    marginTop: 1,
  },
  room_title: {
    flex: 1,
    fontSize: 14,
    fontWeight: "500",
  },
  room_details: {},
  room_details_description: {
    flex: 1,
    fontSize: 12,
  },
  room_user_members: {
    flexDirection: "row",
    marginTop: 5,
    alignItems: "center",
  },
  room_users_image: {
    backgroundColor: "#F1F2F4",
    width: 30,
    height: 30,
    borderRadius: 100,
    marginRight: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  room_user_image: {
    width: 30,
    height: 30,
    borderRadius: 100,
    resizeMode: "contain",
  },
  room_user_title: {
    fontSize: 12,
  },
  room_background_image: {
    width: 45,
    height: 45,
    borderRadius: 100,
    resizeMode: "contain",
  },
  rooms_user_count: { marginLeft: 3 },
  rooms_user_count_title: {
    fontSize: 12,
  },
  main_schedule_container: { flex: 1, backgroundColor: "white" },
  custom_list_header: {
    backgroundColor: "#F1F2F4",
    paddingTop: 10,
    paddingBottom: 10,
    paddingLeft: 15,
  },
  custom_list_header_title: { fontSize: 16, fontWeight: "600" },
  schedule_component_container: {
    paddingTop: 10,
    paddingBottom: 10,
    paddingLeft: 15,
    paddingRight: 15,
    borderBottomWidth: 1,
    borderBottomColor: "#F1F2F4",
    flexDirection: "row",
  },
  schedule_component_container_icon: {
    marginRight: 10,
  },
  schedule_component_container_titles: {
    flex: 1,
    flexDirection: "column",
  },
  schedule_component_title: {
    fontSize: 14,
    fontWeight: "500",
    marginBottom: 3,
  },
  schedule_time_date: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "flex-end",
  },
  schedule_component_time: {
    fontSize: 12,
    color: "gray",
  },
  schedule_component_date: {
    fontSize: 10,
    color: "gray",
  },
  room_wrapper_container: {
    flex: 1,
  },
  //Room Details Style
  room_screen_container: {
    flex: 1,
    backgroundColor: "white",
  },
  room_members_container: {
    height: 200,
    flexDirection: "column",
    paddingLeft: 25,
    paddingRight: 25,
    // backgroundColor: "pink",
  },
  room_members_wrapper: {
    flexDirection: "row",
    alignItems: "center",
    marginBottom: 10,
  },
  room_details_members_image: {
    width: 30,
    height: 30,
    borderRadius: 100,
    resizeMode: "contain",
  },
  room_details_members_title: {
    marginLeft: 5,
    fontWeight: "500",
  },
  room_screen_container_title: {
    flexDirection: "row",
    alignItems: "center",
    paddingLeft: 20,
    paddingRight: 20,
    paddingTop: 10,
  },
  room_details_group_image: {
    width: 45,
    height: 45,
    borderRadius: 100,
    resizeMode: "contain",
  },
  room_details_group_title_wrapper: {
    height: 45,
    marginLeft: 5,
    alignItems: "flex-start",
    justifyContent: "center",
  },
  room_details_group_title: {
    fontSize: 16,
    fontWeight: "500",
  },
  room_details_group_createdAt: {
    fontSize: 10,
    fontWeight: "500",
    color: "#585757",
  },
  room_screen_container_desciption: {
    paddingLeft: 20,
    paddingRight: 20,
    paddingBottom: 10,
    paddingTop: 10,
  },
  room_screen_container_desciption_title: {
    fontSize: 15,
  },
  //Custom Members Modal
  custom_modal_container: {
    flex: 1,
    backgroundColor: "white",
  },
  custom_modal_wrapper: {},
});
